import React from "react";
import { useParams } from "react-router-dom";

const TopicDetail = () => {
  const { topicName } = useParams();

  return (
    <div>
      <h2>{topicName.replace(/-/g, " ")}</h2>
      <p>Details about {topicName.replace(/-/g, " ")} will be displayed here.</p>
    </div>
  );
};

export default TopicDetail;
